private void webBrowser1_DocumentCompleted(object sender, WebBrowserDocumentCompletedEventArgs e)\n{\n    // Check if all frames are loaded\n    bool allFramesLoaded = true;\n    foreach (HtmlWindow frame in webBrowser1.Document.Window.Frames)\n    {\n        if (frame.Document.ReadyState != "complete")\n        {\n            allFramesLoaded = false;\n            break;\n        }\n    }\n\n    if (allFramesLoaded)\n    {\n        // All frames are loaded, you can proceed with your logic here\n        Console.WriteLine("All frames are loaded");\n    }\n}